-- -----------------------------------------------------
-- Schema events_management_system
-- -----------------------------------------------------
DROP SCHEMA IF EXISTS `events_management_system` ;

-- -----------------------------------------------------
-- Schema events_management_system
-- -----------------------------------------------------
CREATE SCHEMA IF NOT EXISTS `events_management_system` DEFAULT CHARACTER SET utf8mb4 ;
USE `events_management_system` ;

-- -----------------------------------------------------
-- Table `events_management_system`.`venue`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `events_management_system`.`venue` ;

CREATE TABLE IF NOT EXISTS `events_management_system`.`venue` (
  `venue_id` INT(11) NOT NULL,
  `name` VARCHAR(55) NULL DEFAULT NULL,
  `city` VARCHAR(55) NULL DEFAULT NULL,
  `capacity` VARCHAR(55) NULL DEFAULT NULL,
  PRIMARY KEY (`venue_id`))
ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4;


-- -----------------------------------------------------
-- Table `events_management_system`.`organization`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `events_management_system`.`organization` ;

CREATE TABLE IF NOT EXISTS `events_management_system`.`organization` (
  `organization_id` INT(11) NOT NULL,
  `name` VARCHAR(55) NULL DEFAULT NULL,
  `email` VARCHAR(55) NULL DEFAULT NULL,
  `phone_number` VARCHAR(55) NULL DEFAULT NULL,
  PRIMARY KEY (`organization_id`))
ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4;


-- -----------------------------------------------------
-- Table `events_management_system`.`event`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `events_management_system`.`event` ;

CREATE TABLE IF NOT EXISTS `events_management_system`.`event` (
  `event_id` INT(11) NOT NULL,
  `title` VARCHAR(55) NULL DEFAULT NULL,
  `description` VARCHAR(55) NULL DEFAULT NULL,
  `start_date` DATE NULL DEFAULT NULL,
  `end_date` DATE NULL DEFAULT NULL,
  `maximum_attendees` INT(11) NULL DEFAULT NULL,
  `venue_id` INT(11) NULL DEFAULT NULL,
  `organization_id` INT(11) NULL DEFAULT NULL,
  PRIMARY KEY (`event_id`),
  INDEX `venue_id` (`venue_id` ASC),
  INDEX `organization_id` (`organization_id` ASC),
  CONSTRAINT `event_ibfk_1`
    FOREIGN KEY (`venue_id`)
    REFERENCES `events_management_system`.`venue` (`venue_id`),
  CONSTRAINT `event_ibfk_2`
    FOREIGN KEY (`organization_id`)
    REFERENCES `events_management_system`.`organization` (`organization_id`))
ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4;


-- -----------------------------------------------------
-- Table `events_management_system`.`speaker`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `events_management_system`.`speaker` ;

CREATE TABLE IF NOT EXISTS `events_management_system`.`speaker` (
  `speaker_id` INT(11) NOT NULL,
  `first_name` VARCHAR(55) NULL DEFAULT NULL,
  `last_name` VARCHAR(55) NULL DEFAULT NULL,
  `bio` VARCHAR(255) NULL DEFAULT NULL,
  `expertise` VARCHAR(55) NULL DEFAULT NULL,
  `phone_number` VARCHAR(55) NULL DEFAULT NULL,
  PRIMARY KEY (`speaker_id`))
ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4;


-- -----------------------------------------------------
-- Table `events_management_system`.`event_speaker`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `events_management_system`.`event_speaker` ;

CREATE TABLE IF NOT EXISTS `events_management_system`.`event_speaker` (
  `id` INT(11) NOT NULL,
  `speaker_id` INT(11) NULL DEFAULT NULL,
  `event_id` INT(11) NULL DEFAULT NULL,
  `presentation_title` LONGTEXT NULL DEFAULT NULL,
  `stage_order` INT(11) NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  INDEX `speaker_id` (`speaker_id` ASC),
  INDEX `event_id` (`event_id` ASC),
  CONSTRAINT `event_speaker_ibfk_1`
    FOREIGN KEY (`speaker_id`)
    REFERENCES `events_management_system`.`speaker` (`speaker_id`),
  CONSTRAINT `event_speaker_ibfk_2`
    FOREIGN KEY (`event_id`)
    REFERENCES `events_management_system`.`event` (`event_id`))
ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4;


-- -----------------------------------------------------
-- Table `events_management_system`.`sponsor`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `events_management_system`.`sponsor` ;

CREATE TABLE IF NOT EXISTS `events_management_system`.`sponsor` (
  `sponsor_id` INT(11) NOT NULL,
  `company_name` VARCHAR(55) NULL DEFAULT NULL,
  `email` VARCHAR(55) NULL DEFAULT NULL,
  `phone_number` VARCHAR(55) NULL DEFAULT NULL,
  PRIMARY KEY (`sponsor_id`))
ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4;


-- -----------------------------------------------------
-- Table `events_management_system`.`event_sponsor`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `events_management_system`.`event_sponsor` ;

CREATE TABLE IF NOT EXISTS `events_management_system`.`event_sponsor` (
  `id` INT(11) NOT NULL,
  `event_id` INT(11) NULL DEFAULT NULL,
  `sponsor_id` INT(11) NULL DEFAULT NULL,
  `amount` INT(11) NULL DEFAULT NULL,
  `sponsorship_type` VARCHAR(55) NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  INDEX `event_id` (`event_id` ASC),
  INDEX `sponsor_id` (`sponsor_id` ASC),
  CONSTRAINT `event_sponsor_ibfk_1`
    FOREIGN KEY (`event_id`)
    REFERENCES `events_management_system`.`event` (`event_id`),
  CONSTRAINT `event_sponsor_ibfk_2`
    FOREIGN KEY (`sponsor_id`)
    REFERENCES `events_management_system`.`sponsor` (`sponsor_id`))
ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4;


-- -----------------------------------------------------
-- Table `events_management_system`.`user`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `events_management_system`.`user` ;

CREATE TABLE IF NOT EXISTS `events_management_system`.`user` (
  `user_id` INT(11) NOT NULL,
  `first_name` VARCHAR(55) NULL DEFAULT NULL,
  `last_name` VARCHAR(55) NULL DEFAULT NULL,
  `city` VARCHAR(55) NULL DEFAULT NULL,
  `gender` VARCHAR(55) NULL DEFAULT NULL,
  `phone_number` VARCHAR(55) NULL DEFAULT NULL,
  `email` VARCHAR(55) NULL DEFAULT NULL,
  PRIMARY KEY (`user_id`))
ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4;


-- -----------------------------------------------------
-- Table `events_management_system`.`user_attend`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `events_management_system`.`user_attend` ;

CREATE TABLE IF NOT EXISTS `events_management_system`.`user_attend` (
  `id` INT(11) NOT NULL,
  `user_id` INT(11) NULL DEFAULT NULL,
  `event_id` INT(11) NULL DEFAULT NULL,
  `ticket_price` INT(11) NULL DEFAULT NULL,
  `payment_method` VARCHAR(55) NULL DEFAULT NULL,
  `status` VARCHAR(55) NULL DEFAULT NULL,
  `date` DATE NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  INDEX `user_id` (`user_id` ASC),
  INDEX `event_id` (`event_id` ASC),
  CONSTRAINT `user_attend_ibfk_1`
    FOREIGN KEY (`user_id`)
    REFERENCES `events_management_system`.`user` (`user_id`),
  CONSTRAINT `user_attend_ibfk_2`
    FOREIGN KEY (`event_id`)
    REFERENCES `events_management_system`.`event` (`event_id`))
ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4;


